import { Component } from '@angular/core';
import { MediaService } from 'src/service/media.service';
import { SignalR } from 'src/service/signalr.utils';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.scss']
})
export class AppComponent {
  public userId: string;
  public userName: string;

  constructor(private readonly _mediaService: MediaService) {
    this.userId = crypto.randomUUID();
    this.userName = "Test " + this.userId;
    debugger;
    SignalR.startConnection(this.userId, this.userName);
  }
}
